import { Component, triggerEventOnly, triggerCatchEvent, } from '../../_util/simply';
Component({
    image: '',
    title: '',
    brief: '',
    arrow: false,
    extra: '',
    extraBrief: '',
    disabled: false,
    showDivider: true,
}, {
    onTap: function (e) {
        if (this.props.disabled) {
            return;
        }
        triggerEventOnly(this, 'tap', e);
    },
    catchTap: function (e) {
        if (this.props.disabled) {
            return;
        }
        triggerCatchEvent(this, 'catchTap', e);
    },
});
